package LeetCode;
import java.util.HashMap;

public class Anagram {

    public static HashMap<Character,Integer> createOccurrenceMap(String A){
        HashMap<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < A.length(); i++) {
            if (map.containsKey(A.charAt(i)))
                map.replace(A.charAt(i), map.get(A.charAt(i)) + 1);
            else
                map.put(A.charAt(i), 1);
        }
        return map;
    }

    public static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) return false;
        HashMap<Character, Integer> mapOfS = createOccurrenceMap(s);
        HashMap<Character, Integer> mapOfT = createOccurrenceMap(t);

        for (int i = 0; i < t.length(); i++) {
            if (!mapOfS.containsKey(t.charAt(i)) || !(mapOfS.get(t.charAt(i)).equals(mapOfT.get(t.charAt(i)))))
                return false;
        }
        return true;
    }

    public static void main(String[] args) {
    String s = "";
    String t = "";
    String a = "aacc";
    String b = "ccac";
    System.out.println(Anagram.isAnagram(a,b));
    }
}
